import React, { useState } from 'react';
import Router from './AppRouter'
function App() {
	const [isLoggedIn, setLogin] = useState(true);
  	return (
    	<div className="App">
			<Router isLoggedIn={isLoggedIn}/>
    	</div>
	);
}

export default App;
